const MemberList = ()=>{
	return(
		<div className="flexBox2">
			<h3>MemberList</h3>
			<ul>
				<li>joe</li>
				<li>Anna</li>
				<li>Billy</li>
				<li>Ed</li>
			</ul>
		</div>
	)
}

export default MemberList;
